    false,nt"url": null,nt"notes": "Multibeam, single beam, and subbottom sonar
    data will be collected 24 hours a day and XBT casts will be conducted at an interval
    defined by prevailing oceanographic conditions, but not to exceed 3-4 hours.  EX1404L1
    will perform baseline characterization mapping (multibeam, splitbeam, subbottom)
    of New England Seamount chain in preparation for EX1404L3. During transiting to
    and from seamounts, exploration mapping will include areas of poor quality from
    existing ECS data and gaps in ECS data.",nt"license_title": null,nt"extras":
